    //       </Link>
    //     </li>
    //     <li><Link onClick={ logout } to="/">
    //       <span>LOGOUT</span>
    //     </Link>
    //     </li>
    //   </ul>

    // </nav>
    <Dropdown trigger={ trigger } pointing='top left' icon={ null }>
      <Dropdown.Menu text="Exercises"  >
        <Dropdown.Item text='Exercise List' as={ Link } to='/exercises' />
        <Dropdown.Item />
      </Dropdown.Menu>
      <Dropdown.Menu>
        <Dropdown.Item />
      </Dropdown.Menu>
      <Dropdown.Menu></Dropdown.Menu>
    </Dropdown>
  );
};
Navbar.propTypes = {
  logout: PropTypes.func.isRequired,
};

export default connect(null, { logout })(Navbar);
